import React from "react";
import ExpenceItem from "./ExpenceItem";

import "./Expences.css";

const Expences = ({ expenses }) => {
  return (
    <div className="expenses">
      <ExpenceItem expenses={expenses} />
    </div>
  );
};

export default Expences;
